import React from "react";

import "./styles/App.css";

import { Home } from "./pages/Home";
import { Contact } from "./pages/Contact";
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Router>
        <Route path='/'><h1></h1></Route>
      </Router>
    </>
  );
}

export default App;
